import React, { useEffect, useState } from "react";
import './Doctprofile.css';
import axios from "axios";
import { Card, ListGroupItem, ListGroup,Container } from "react-bootstrap";
import 'bootstrap/dist/css/bootstrap.min.css';
function Doctprofile() {
    const [person, setperson] = useState(Array);

    useEffect(() => {
        axios.get("http://localhost:5000/doctor")
            .then(res => {
                setperson(res.data.dr);
            });
    }, [])

    function deletedoct(e) {
        console.log(e.target.id);
    }

    return (
        <Container>
            {person.map((user) => (
                <div className="user">
                    {user.map((users) => (
                        <div className="user">{users.name}</div>
                    ))}
                </div>
            ))}
        </Container>
    );
}


export default Doctprofile;
